.hotZone {
    position: absolute;
    left: 20px;
    top: 40px;
    width: 420px;
    height: 150px;
    
    background: transparent;
    pointer-events: auto;
    display: flex;
    align-items: center;
    justify-content: center;
}

.buttonWrapper {
    width: 379px;
    height: 124px;
    border-radius: 30px;
    padding: 2px;
    
    background: linear-gradient(180deg, #DB83FD 0%, #463959 100%);
    transition: transform 0.3s ease, box-shadow 0.3s ease;
    overflow: visible;
    position: relative;
}

.customButton {
    width: 100%;
    height: 100%;
    border-radius: 30px;
    opacity: 1;
    background: linear-gradient(180deg, #22103D 0%, #0E0719 100%);
    
    display: flex;
    align-items: center;
    justify-content: center;
    cursor: pointer;
    transition: transform 0.3s ease, opacity 0.3s ease;
    position: relative;
    z-index: 1;
}

/* 悬停效果AIoldX */
.buttonWrapper:hover {
    transform: scale(1.05); 
    box-shadow: 0 0 15px 5px rgba(219, 131, 254, 0.7);
}

/* 悬停时字体变为白色 */
.buttonWrapper:hover .buttonText {
    background: none;
    -webkit-background-clip: unset;
    -webkit-text-fill-color: white;
    color: white;
}

/* 点击效果AIoldX */
.buttonWrapper:active {
    transform: scale(0.95);
    box-shadow: 0 0 10px 3px rgba(219, 131, 254, 0.9);
}

.buttonText {
    font-size: 34px;
    font-weight: bold;
    font-family: Arial, sans-serif;
    
    background: linear-gradient(180deg, #DB83FE 7%, #834E98 97%);
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    transition: color 0.3s ease;
}




